import React from 'react';
import Loader from '../../components/Loader';

class SingleSeries extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            show: null
        };
    }

    render(){
        return (
            <div>
                <p>
                    Single Series - the show id will be {this.props.match.params.id}
                </p>
            </div>
        );
    }
}

export default SingleSeries;
